import React, { useState } from "react";
import UsersList from "./UsersList";

function List1(props) {
  const Data = [
    {
      id: Math.random().toString(),
      name: {
        salutation: "Mr.",
        first: "Jatin",
        last: "Patel",
      },
    },
    {
      id: Math.random().toString(),
      name: {
        salutation: "Mrs.",
        first: "Anjali",
        last: "Shah",
      },
    },
    {
      id: Math.random().toString(),
      name: {
        salutation: "Mr.",
        first: "Darsh",
        last: "Gajjar",
      },
    },
    {
      id: Math.random().toString(),
      name: {
        salutation: "Mrs.",
        first: "Ishita",
        last: "Verma",
      },
    },
    {
      id: Math.random().toString(),
      name: {
        salutation: "Mr.",
        first: "Devarsh",
        last: "Prajapati",
      },
    },
    {
      id: Math.random().toString(),
      name: {
        salutation: "Mrs.",
        first: "Justin",
        last: "Trudeau",
      },
    },
    {
      id: Math.random().toString(),
      name: {
        salutation: "Mr.",
        first: "Dwayne",
        last: "Johnson",
      },
    },
    {
      id: Math.random().toString(),
      name: {
        salutation: "Mrs.",
        first: "Janki",
        last: "Barot",
      },
    },
  ];
  const [outputUserList1, setOutputUserList1] = useState(Data);
  setOutputUserList1(Data.filter((item) => {
    const Name1 = `${item.name.salutation} ${item.name.first} ${item.name.last} `;
    return Name1.toLowerCase().includes(props.searchVal);
  }))
  return (
    <div>
      <UsersList outputUsersList={outputUserList1} />
    </div>
  );
}
export default List1;
